import React from 'react';
import { Route, Redirect, Switch } from 'react-router-dom';
import Reader from './Reader/Reader';
import publications from './publications';



const App = () => {
  return (
    <Switch>
      <Route render={(props) => <Reader {...props} items={publications} />} />
      <Redirect />
    </Switch>
  )
}

export default App;
